using Microsoft.ML;
using System;
using System.IO;

namespace NonToxic.Model
{
    public class Engine
    {
        private const string ML_MODEL_BASE64ENCODED = "";

        private readonly PredictionEngine<SampleObservation, SamplePrediction> _predEngine;

        public Engine()
        {
            var modelData = Convert.FromBase64String(ML_MODEL_BASE64ENCODED);
            var modelStream = new MemoryStream(modelData);

            MLContext mlContext = new MLContext();
            ITransformer mlModel = mlContext.Model.Load(modelStream, out DataViewSchema inputSchema);
            _predEngine = mlContext.Model.CreatePredictionEngine<SampleObservation, SamplePrediction>(mlModel);
        }

        public bool Predict(string utterance)
        {
            SampleObservation sampleData = new SampleObservation(utterance);
            return _predEngine.Predict(sampleData).Prediction;
        }
    }
}
